import { useEffect, useState } from "react";
import { useAppDispatch, useAppSelector } from "../../app/hooks";
import { logout } from "../../services/Auth/AuthSlice";
import './styles.css';
import CarCard from "./CarCard";
import { selectCarList } from "../../services/Car/CarSelectors";

// Define types for our new components
interface PreviousBooking {
  id: number;
  carName: string;
  image: string;
  pickupLocation: string;
  dropoffLocation: string;
  pickupDate: string;
  dropoffDate: string;
  status: 'completed' | 'upcoming' | 'cancelled';
  price: string;
}

interface Review {
  id: number;
  userName: string;
  rating: number;
  comment: string;
  date: string;
  avatar: string;
}

const Dashboard = () => {
  // Helper function to format date strings

  const formatDate = (dateString: string) => {
    const options: Intl.DateTimeFormatOptions = { year: 'numeric', month: 'short', day: 'numeric' };
    return new Date(dateString).toLocaleDateString('en-US', options);
  };

  const [activeTime, setActiveTime] = useState('all');
  const [searchInput, setSearchInput] = useState('');
  const [isSearchModalOpen, setIsSearchModalOpen] = useState(false);
  const [showResults, setShowResults] = useState(false);
  const [activeTab, setActiveTab] = useState('all-cars');
  const [isFilterPageOpen, setIsFilterPageOpen] = useState(false);
  const [showLoginPage, setShowLoginPage] = useState(false);
  const { user, isLoading, error } = useAppSelector((state) => state.auth);
  const cars = useAppSelector(selectCarList);
  console.log('Cars:', cars);

  // New states for booking form
  const [previousBookings, setPreviousBookings] = useState<PreviousBooking[]>([
    {
      id: 1,
      carName: "Tesla Model Y",
      image: "/api/placeholder/100/80",
      pickupLocation: "JFK Airport",
      dropoffLocation: "Manhattan Downtown",
      pickupDate: "2023-03-15",
      dropoffDate: "2023-03-18",
      status: "completed",
      price: "$245"
    },
    {
      id: 2,
      carName: "Ford Mustang Convertible",
      image: "/api/placeholder/100/80",
      pickupLocation: "Brooklyn Heights",
      dropoffLocation: "Brooklyn Heights",
      pickupDate: "2023-04-02",
      dropoffDate: "2023-04-03",
      status: "completed",
      price: "$120"
    },
    {
      id: 3,
      carName: "Toyota Camry",
      image: "/api/placeholder/100/80",
      pickupLocation: "LaGuardia Airport",
      dropoffLocation: "Staten Island",
      pickupDate: "2023-05-10",
      dropoffDate: "2023-05-12",
      status: "cancelled",
      price: "$175"
    },
    {
      id: 4,
      carName: "BMW X5",
      image: "/api/placeholder/100/80",
      pickupLocation: "Manhattan Midtown",
      dropoffLocation: "Manhattan Midtown",
      pickupDate: "2023-06-21",
      dropoffDate: "2023-06-25",
      status: "upcoming",
      price: "$480"
    }
  ]);
  // Sample reviews data
  const [reviews, setReviews] = useState<Review[]>([
    {
      id: 1,
      userName: "John D.",
      rating: 5,
      comment: "Excellent service! The car was clean and in perfect condition.",
      date: "April 15, 2023",
      avatar: "/api/placeholder/40/40"
    },
    {
      id: 2,
      userName: "Sarah M.",
      rating: 4,
      comment: "Great experience overall. Pickup was fast and hassle-free.",
      date: "March 28, 2023",
      avatar: "/api/placeholder/40/40"
    },
    {
      id: 3,
      userName: "Robert K.",
      rating: 5,
      comment: "Best car rental service I've used. Will definitely rent again!",
      date: "April 2, 2023",
      avatar: "/api/placeholder/40/40"
    }
  ]);

  const dispatch = useAppDispatch();

  const handleSearchChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    setSearchInput(e.target.value);
  };

  const handleSearchSubmit = (e: React.FormEvent<HTMLFormElement>) => {
    e.preventDefault();
    setIsSearchModalOpen(true);
  };

  const handleSearchClick = (e: React.MouseEvent<HTMLButtonElement, MouseEvent>) => {
    e.preventDefault();
    setIsSearchModalOpen(true);
  };

  const handleApplyFilters = (filters: any) => {
    console.log('Applied filters:', filters);
    setShowResults(true);
  };

  const handleLogout = () => {
    dispatch(logout());
  };

  const handleLoginButtonClick = () => {
    setShowLoginPage(true);
  };

  // // Booking form handlers
  // const handleBookingFormChange = (e: React.ChangeEvent<HTMLInputElement | HTMLSelectElement>) => {
  //   const { name, value } = e.target;
  //   setBookingForm(prev => ({
  //     ...prev,
  //     [name]: value
  //   }));
  // };

  // const handleBookingSubmit = (e: React.FormEvent<HTMLFormElement>) => {
  //   e.preventDefault();
  //   console.log('Booking submitted:', bookingForm);
  //   // Here you would typically dispatch an action to submit the booking
  //   alert('Booking submitted successfully!');
  // };

  // When user state changes and we have a user, return to homepage
  useEffect(() => {
    if (user) {
      setShowLoginPage(false);
    }
  }, [user]);

  const vehicleCategories = [
    { name: 'SUVs', icon: '🚙' },
    { name: 'Compact cars', icon: '🚗' },
    { name: 'Luxury cars', icon: '🏎️' },
    { name: 'Economy', icon: '💰' },
  ];

  const carListings = [
    {
      id: 1,
      name: 'Luxury Sedan (Gasoline)',
      type: 'Sedan',
      fuelType: 'Gasoline',
      location: 'Downtown',
      date: '17/08/2023',
      rate: '$50/day',
      city: 'City Center',
      image: '/api/placeholder/250/250'
    },
    {
      id: 2,
      name: 'Electric SUV (Battery)',
      type: 'SUV',
      fuelType: 'Electric',
      location: 'Uptown',
      date: '18/08/2023',
      rate: '$65/day',
      city: 'Metro Area',
      image: '/api/placeholder/250/250'
    },
    {
      id: 3,
      name: 'Compact Hybrid',
      type: 'Compact',
      fuelType: 'Hybrid',
      location: 'Airport',
      date: '19/08/2023',
      rate: '$45/day',
      city: 'Airport Zone',
      image: '/api/placeholder/250/250'
    }
  ];

  // Function to render stars based on rating
  const renderStars = (rating: number) => {
    const stars = [];
    for (let i = 1; i <= 5; i++) {
      stars.push(
        <span key={i} className={`star ${i <= rating ? 'filled' : 'empty'}`}>
          {i <= rating ? '★' : '☆'}
        </span>
      );
    }
    return stars;
  };

  // Results page view
  const renderResultsPage = () => (
    <div className="results-container">
      {/* Tabs */}
      <div className="tabs-container">
        <button 
          className={`tab ${activeTab === 'your-bookings' ? 'active-tab' : ''}`}
          onClick={() => setActiveTab('your-bookings')}
        >
          Your Bookings
        </button>
        <button 
          className={`tab ${activeTab === 'all-cars' ? 'active-tab' : ''}`}
          onClick={() => setActiveTab('all-cars')}
        >
          All Cars
        </button>
      </div>

      {/* Car Listings */}
      <div className="car-listings">
        {carListings.map((car) => (
          <div key={car.id} className="car-listing-item">
            {/* Car Image */}
            <div className="car-image">
              <img src={car.image} alt={car.name} />
            </div>

            {/* Car Details */}
            <div className="car-details">
              <h3>{car.name}</h3>
              <p>{car.city} - {car.date}</p>
              <p className="car-rate">Rate: {car.rate}</p>
              <p>Location: {car.location}</p>

              {/* Right Arrow */}
              <div className="car-arrow">▶</div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );

  return (
    <div className="app-container">

      {/* Main Content */}
      {showResults ? (
        renderResultsPage()
      ) : (
        <main>
          {/* Hero Section */}
          <section className="hero-section">
            <div className="hero-image">
              <img src="https://advertising.expedia.com/wp-content/uploads/2020/08/Car-Hero_1920x800.jpg" alt="Car Banner" />
            </div>
            <div className="hero-content">
              <h1>Discover the perfect ride for your journey.</h1>
              <div className="search-form-container">
                <form onSubmit={handleSearchSubmit}>
                  <input 
                    type="text" 
                    placeholder="Enter location or car model" 
                    value={searchInput}
                    onChange={handleSearchChange}
                  />
                  <button className="search-button">Search</button>
                </form>
              </div>
              <p>Book your ideal car with ease and convenience at the most competitive rates.</p>
            </div>
          </section>

          {/* Vehicle Categories */}
          <section className="categories-section">
            <div className="categories-grid">
              {vehicleCategories.map((category, index) => (
                <button key={index} className="category-button">
                  <span className="category-icon">{category.icon}</span>
                  <span>{category.name}</span>
                </button>
              ))}
            </div>
          </section>

          {/* Popular in New York */}
          <section className="popular-section">
            <h2>Popular in New York</h2>
            <div className="time-filters">
              <button 
                className={`time-filter ${activeTime === 'all' ? 'active-filter' : ''}`}
                onClick={() => setActiveTime('all')}
              >
                All
              </button>
              <button 
                className={`time-filter ${activeTime === 'today' ? 'active-filter' : ''}`}
                onClick={() => setActiveTime('today')}
              >
                Today
              </button>
              <button 
                className={`time-filter ${activeTime === 'tomorrow' ? 'active-filter' : ''}`}
                onClick={() => setActiveTime('tomorrow')}
              >
                Tomorrow
              </button>
              <button 
                className={`time-filter ${activeTime === 'this-week' ? 'active-filter' : ''}`}
                onClick={() => setActiveTime('this-week')}
              >
                This week
              </button>
              <button 
                className={`time-filter ${activeTime === 'next-week' ? 'active-filter' : ''}`}
                onClick={() => setActiveTime('next-week')}
              >
                Next week
              </button>
            </div>
            <div className="cars-grid">
              {cars.filter((car) => (car.State === user?.state)).slice(0, 10).map((car) => (
                <CarCard key={car.Car_Id} {...car} />
              ))}
            </div>
          </section>

          {/* Booking History Section */}
<section className="booking-section">
  <h2>Your Booking History</h2>
  <div className="booking-history-container">
    {previousBookings.map(booking => (
      <div key={booking.id} className="booking-card">
        <div className="booking-image">
